import React from 'react';

const Footer = () => {
  // Estilos en línea para el Footer
  const footerStyle = {
    backgroundColor: '#333',
    color: '#fff',
    textAlign: 'center',
    padding: '10px 0',
    fontSize: '1rem',
    position: 'relative',
    bottom: '0',
    width: '100%',
  };

  return (
    <footer style={footerStyle}>
      <p>Nissan GTR R35 © 2024</p>
    </footer>
  );
};

export default Footer;
